import React from 'react';
import { Link } from 'react-router-dom';

import logoImg from '../../assets/images/logo.svg';
import backIcon from '../../assets/images/icons/back.svg';

import './styles.css';
import PageHeader from '../../components/PageHeader';

function TeacherList() {
    return (
        <div id="page-teacher-list" className="container">
            <PageHeader title="Estes são os proffys disponiveis.">
                <form id="search-teachers">

                    <div className="input-block">
                        <label htmlFor="subject">Matéria</label>
                        <input type="text" id="subject" />
                    </div>

                    <div className="input-block">
                        <label htmlFor="week_day">Dia da Semana</label>
                        <input type="text" id="week_day" />
                    </div>

                    <div className="input-block">
                        <label htmlFor="time">Hora</label>
                        <input type="text" id="time" />
                    </div>

                </form>
            </PageHeader>

            <main>
                <article className="teacher-item">
                    <header>
                        <img src="https://instagram.fmii2-1.fna.fbcdn.net/v/t51.2885-19/s320x320/116720412_3114376421964721_991284484523079640_n.jpg?_nc_ht=instagram.fmii2-1.fna.fbcdn.net&_nc_ohc=zSo1srv5aP8AX9IVF6n&oh=9c619ffcd89d414272e8ff69f0a22fba&oe=5F55F4F9" alt=""/>
                    </header>
                </article>
            </main>
        </div>
    )
}

export default TeacherList;
